  return (
    <>
      <Input label="Agregar Dato" placeholder="Ej: 9" type="number" />
    </>
  );
}
function ModalTipoDeDatosSelect(list) {
  return (
    list.map((item, index) => (
      <Grid xs={4} sm={6} key={index}>
          <Card isPressable onClick={handlerInputs}>
              <Card.Body css={{ p: 0 }}>
                  <Card.Image
                      src={item.img}
                      objectFit="cover"
                      width="100%"
                      height={140}
                      alt={item.title}
                  />
              </Card.Body>
              <Card.Footer css={{ justifyItems: "center" }}>
                  <Row wrap="wrap" justify="center" align="center">
                      <Text b>{item.title}</Text>
                  </Row>
              </Card.Footer>
          </Card>
      </Grid>
  ))
  );
}
export {ModalTipoDeDatos,ModalTipoDeDatosSelect}
